var table = new Tabulator("#tabla_libretas", {
  layout: "fitDataTable",
  ajaxURL: "../datos_tabla_libretas.php",
  ajaxCache: false,
  pagination: "local",
  paginationSize: 11,
  frozenRows: 0,

  //field se refiere a la clave del json
  columns: [
    {
      title: "Estudiante: ",
      columns: [
        {
          title: "DNI: ",
          columns: [
            {
              title: "Sede: ",
              columns: [
                {
                  title: "Año: ",
                  columns: [
                    { title: "Materia", field: "nombre_materia" },
                    { title: "1º Trimestre", field: "T1N2Promedio" },
                    { title: "2º Trimestre", field: "T2N2Promedio" },
                    { title: "3º Trimestre", field: "T3N2Promedio" },
                    { title: "Promedio Trimestral", field: "T4N1PromTrim" },
                    { title: "DIC", field: "T4N2Diciembre" },
                    { title: "FEB", field: "T4N3Febrero" },
                    { title: "Calificación Definitiva", field: "T4N5CalifDef" },
                  ],
                },
              ],
            },
          ],
        },
      ],
    },
  ],
});

table.on("dataLoaded", function (data) {
  if (data.length > 0) {
    let nombre = data[0].nombre_alumno;
    let dni = data[0].dni_alumno;
    let sede = data[0].nombre_sede;
    let ano = data[0].ano_alumno;

    table.setColumns([
      {
        title: `Estudiante: ${nombre}`,
        columns: [
          {
            title: `DNI: ${dni}`,
            columns: [
              {
                title: `Sede: ${sede}`,
                columns: [
                  {
                    title: `Año: ${ano}º`,
                    columns: [
                      { title: "Materia", field: "nombre_materia" },
                      { title: "1º Trimestre", field: "T1N2Promedio" },
                      { title: "2º Trimestre", field: "T2N2Promedio" },
                      { title: "3º Trimestre", field: "T3N2Promedio" },
                      { title: "Promedio Trimestral", field: "T4N1PromTrim" },
                      { title: "DIC", field: "T4N2Diciembre" },
                      { title: "FEB", field: "T4N3Febrero" },
                      {
                        title: "Calificación Definitiva",
                        field: "T4N5CalifDef",
                      },
                    ],
                  },
                ],
              },
            ],
          },
        ],
      },
    ]);
  }
});

document.getElementById("download-pdf").addEventListener("click", function () {
  //Sello
  const selloImg =
    "data:image/png;base64,";

  //Firma
  const logoImg =
    "data:image/png;base64,";

  const firmaImg =
    //Codigo larguisimo
    "data:image/png;base64,";

  table.download("pdf", "Libreta.pdf", {
    orientation: "landscape",

    autoTable: {
      margin: { top: 120, bottom: 100 },

      styles: {
        fontSize: 9,
        cellPadding: 5,
        textColor: [0, 0, 0],
      },

      headStyles: {
        fillColor: [0, 102, 51], // verde institucional
        textColor: [255, 255, 255],
        fontStyle: "bold",
      },

      bodyStyles: {
        fillColor: [255, 255, 255],
      },

      alternateRowStyles: {
        fillColor: [232, 245, 233], // verde muy suave intercalado
      },
    },

    documentProcessing: function (doc) {
      let pageWidth = doc.internal.pageSize.width;
      let pageHeight = doc.internal.pageSize.height;
      let firmaBaseX = pageWidth * 0.8; // 65% del ancho (más a la derecha)

      // ===== ENCABEZADO IZQUIERDA =====
      doc.setFontSize(25);
      doc.setTextColor(0, 102, 51);
      doc.text("ESRTIC", 40, 60); // margen izquierdo fijo

      doc.setFontSize(18);
      doc.setTextColor(70, 70, 70);
      doc.text("Libreta de Calificaciones", 40, 80);

      // ===== LOGO ARRIBA DERECHA =====
      let logoWidth = 96;
      let logoHeight = 82;

      doc.addImage(
        logoImg,
        "PNG",
        pageWidth - 40 - logoWidth, // margen derecho
        15, // un poco más arriba que el texto
        logoWidth,
        logoHeight,
      );
      // Línea verde separadora
      doc.setDrawColor(0, 102, 51);
      doc.setLineWidth(1);
      doc.line(40, 110, pageWidth - 40, 110);

      // Sello
      let selloWidth = 90;
      let selloHeight = 109;

      doc.addImage(
        selloImg,
        "PNG",
        firmaBaseX - 200, // a la izquierda del centro del bloque
        pageHeight - 135,
        selloWidth,
        selloHeight,
      );
      // ===== LINEA DE LA FIRMA =====

      doc.setDrawColor(0, 102, 51);
      doc.setLineWidth(0.8);
      doc.line(
        firmaBaseX - 90,
        pageHeight - 70,
        firmaBaseX + 90,
        pageHeight - 70,
      );

      let imgWidth = 108;
      let imgHeight = 110;

      doc.addImage(
        firmaImg,
        "PNG",
        firmaBaseX - imgWidth / 2,
        pageHeight - 145,
        imgWidth,
        imgHeight,
      );

      doc.setFontSize(10);
      doc.setTextColor(60, 60, 60);
      doc.text("Lic. Jonathan A. Dominguez", firmaBaseX, pageHeight - 55, {
        align: "center",
      });

      doc.text("Coordinador", firmaBaseX, pageHeight - 42, {
        align: "center",
      });
    },
  });
});
